import RoomToggle from "./RoomToggle"

interface RoomToggleProps {
  room: string | undefined
}

function RoomToggles({ room }: RoomToggleProps) {
  const roomList: Record<string, boolean> = {
    "Babies": false,
    "Toddler": false,
    "Pre Kindergarten": false,
    "Kindergarten": false,
    "Preschool": false
  }
  return (
    <div className='roomToggle'>
      <p>Current room : {room ? room : "Not signed into a room"}</p>
      {
        Object.keys(roomList).map((roomName: string) => (
          <li key={roomName}>
            <RoomToggle roomName={roomName} isSignedIn={roomList.isSignedIn} />
          </li>
        ))
      }
    </div>
  )
}

export default RoomToggles
